import React from 'react'
import {Avatar, FormControlLabel, Grid, Paper, TextField, Switch, Button} from '@material-ui/core'
import VpnKeyIcon from '@material-ui/icons/VpnKey';
const SignIn=()=>{
    const paperStyle={padding :20, height:'70vh', width:280, margin:'20px auto'}
    const avatarStyle={backgroundColor:'green'}
    return(
        <Grid>
            <Paper elevation={5} style={paperStyle}>
                <Grid align='center'>
                    <Avatar variant='rounded'><VpnKeyIcon/></Avatar>
                    <h2>Sign in</h2>
                </Grid>
                <TextField id="outlined-basic" label='Username' placeholder='Enter username' align='center' required/>
                <TextField id="outlined-basic" label='Password' placeholder='Enter password' align='center' type='password' required/>
                <FormControlLabel
                    control={<Switch name="switchA" color="primary"/>}
                    label="Remember me"
                />
                <Button type="submit" color='primary' variant='contained' fullwidth>Sign in</Button>
            </Paper>
        </Grid>
    )
}
export default SignIn
